import classes from './AvailableHardW.module.css'


const AvailableHardW=()=>{
    const HardwareList = PseudoData.map(Hardware => <li>{Hardware.name}</li>);
    return(
        <section className={classes.hardware}>
            <ul>
                {HardwareList}
            </ul>
        </section>
    )
}
const PseudoData=[
    {
      id:'hw1',
      name:'Desktop',
      description: 'Hp Desktops',
      price: Rs45000,  
    },
    {
        id:'hw2',
        name:'Keyboard',
        description: 'Acer Keyboards',
        price: Rs45000,  
      },
      {
        id:'hw3',
        name:'Mouse',
        description: 'Hp Mouse',
        price: Rs45000,  
      },
]
export default AvailableHardW;
